import React from "react";

function ColorBtns() {
  const colors = ["red", "blue", "yellow", "green", "gray"];
  return (
    <div>
      <ul className="colors flex m-2 pl-2">
        {colors.map((item, ind) => (
          <li
            key={ind}
            className={`border-1 pl-2 rounded-full ml-2 w-7 h-7 colorBox`}
            style={{ backgroundColor: item, cursor: "pointer" }}
          ></li>
        ))}
      </ul>
    </div>
  );
}

export default ColorBtns;
